import "./App.css";
import HomePage from "./Pages/HomePage";
import { Route, Routes } from 'react-router-dom';
function App() {
  return (
    <div>
      <HomePage />
      <Routes>
      <Route path="/home" element={<HomeComponent />} />
      <Route path="/about" element={<AboutComponent />} />
      {/* Define other routes here */}
    </Routes>
    </div>
  );
}

export default App;
